  false,\n\t\"url\": null,\n\t\"notes\": \"Hourly Precipitation Data (HPD) Publication
  is archived and available from the National Climatic Data Center (NCDC). This publication
  contains hourly precipitation amounts obtained from recording rain gauges located
  at National Weather Service, Federal Aviation Administration, and cooperative observer
  stations. Published data are displayed in inches to tenths or inches to hundredths
  at local standard time. HPD includes maximum precipitation for nine (9) time periods
  from 15 minutes to 24 hours, for selected stations. The HPD publication is also
  available as digital data set DSI-3240 (C00313).\",\n\t\"license_title\": null,\n\t\"extras\":
